import './TodoItem.css';

function TodoItem(props) {
    return (
        <li className='li_todoItem'>
            <label className='custom-radio-checkbox'>
                <input className='custom-radio-checkbox__input' type='radio' name='genero' value='muje' />

                <span className={`custom-radio-checkbox__show custom-radio-checkbox__show--radio ${props.completed && "otra"}`} ></span>
                <span className='text_todoItem'>
                    <p>{props.text}</p>
                    <p className='text_bold'>12:41 PM</p>
                </span>
            </label>
        </li>
    );
}
export { TodoItem };
